import React from 'react';

function ProjectContainer(props) {
  return (
    <div id="hero" className="jumbotron container-fluid">
      <h1>PROJECTS</h1>
      <div className="container">{props.children}</div>
    </div>
  );
}

export default ProjectContainer;
